import React from 'react';
import { NavLink } from 'react-router-dom'
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import Form from 'react-bootstrap/Form';
import FormControl from 'react-bootstrap/esm/FormControl';
import Button from 'react-bootstrap/Button';

const MyNavigation = () => {

    const activeStyle = {
        backgroundColor: "red",
        padding: "4px 10px",
        borderRadius: "5px",
        color: "#000"
    }
    const setStyle = {
        padding: "3px",
        marginRight: "14px",
        color: "white", 
        paddingRight: "15px"
    }


    return (
        <div>
            <Navbar bg="primary" variant="dark">
                <Navbar.Brand href="#home">Navbar</Navbar.Brand>
                <Nav className="mr-auto">
                    <NavLink exact activeStyle={ activeStyle } style={ setStyle } to='/'> Home </NavLink>
                    <NavLink exact activeStyle={ activeStyle } style={ setStyle } to='/about'> About </NavLink>
                    <NavLink exact activeStyle={ activeStyle } style={ setStyle } to='/contact'> Contact </NavLink>
                    <NavLink exact activeStyle={ activeStyle } style={ setStyle } to='/portfolio'> Portfolio </NavLink>
                </Nav>
                <Form inline>
                    <FormControl type="text" placeholder="Search" className="mr-sm-2" />
                    <Button variant="outline-light">Search</Button>
                </Form>
            </Navbar>
        </div>
    );
};

export default MyNavigation;
